function parseFromHTML(myTableJSONobject) {
	var myRows = document.getElementById("myTable").rows;
	var myCells = document.getElementById("myTable").rows[0].cells;
	var myTable = {};
	docDefinition.content.push(myTable);
	var table = {};
	myTable["table"] = table;
	var myArray = [];
	table["body"] = myArray;
	for (var rowIndex = 0 ; rowIndex < myRows.length ; rowIndex++)
	{
		var myCurrentRow = myRows[rowIndex];
		var myCurrentRowArray = [];
		for (var cellIndex = 0; cellIndex < myCells.length ; cellIndex++)
		{
			var myCurrentRowCell = myCurrentRow.cells[cellIndex];
			var cellText = myCurrentRowCell.innerText;
			myCurrentRowArray.push(cellText);
		}
		myArray.push(myCurrentRowArray);
	}
};